import React from "react";

function TableRows({data}) {
    return (
        <tbody>
            {data.map(datapoint => {
                return <tr key={datapoint.id}>
                    <td>{datapoint.id}</td>
                    <td>{datapoint.name}</td>
                    <td>{datapoint.occupation}</td>
                    <td>{datapoint.salary}</td>
                </tr>
            })}
        </tbody>
    )
};

export default TableRows;
